import React, { Component } from 'react';
import './Bodyframe.css'
import backgroundFrame from "../../img/background_frame.png"

const imgStyle = {

    zIndex: '-1',

}


function mainBody() {
    return ( 
            <main id="contentArea">
              <section id="content">
                    <ul id="category">
                        <a id='ex'>
                            <li id="ex">Job Posts</li>
                        </a>
                        <li>Apply</li>
                        <li>More</li>
                    </ul>
                    <article id='jobboard'>
                        <div id='jobboardImage'>
                        </div>
                    </article>
                </section>
            </main>
        
    );
}

export default mainBody;
